import StyleSheet from '../styles/styleSheet';
const background = StyleSheet.background_color;
const AdminStyleSheet = {
    background: {
        background: `${background}`,
    },

    // Styles for the dashboard.js
    search_bar: {
        width: '75%',
        flex: '7',
        border: `2px solid ${background}`,
        // borderBottom: `2px solid ${background_color}`,
        margin: '2px 2.5px 1px 1.2px',
    },
    search_btn: {
        background: `${background}`,
        flex: '1',
        border: 'none',
        color: 'white',
        width: '20%',
        float: 'right',
        borderRadius: 'none',
    },
    border: {
        border: '1px solid white',
        background: `${background}`,
        color: 'white',
        borderRadius: '4px'
    },
    link_color: {
        color: `white`,
    },
}

export default AdminStyleSheet;
